import React from 'react';
import Header from './components/Header';
import Todos from './components/Todos';
import AddTodo from './components/AddTodo';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <AddTodo />
      <Todos />
    </div>
  );
}

export default App;
